package bean;

import java.util.Date;

public class vieclambean {

  private long mav;
  private String tenviec;
  private String mota;
  private String kynang;
  private String diadiem;
  private Date ngaydang;
  private Date handk;
  private long ngansachtt;
  private long ngansachtd;
  private String maht;
  private long mantd;
  private String kinhnghiem;
  private String malv;

  public vieclambean() {
    super();
    // TODO Auto-generated constructor stub
  }

  public vieclambean(long mav, String tenviec, String mota, String kynang, String diadiem,
      Date ngaydang, Date handk, long ngansachtt, long ngansachtd, String maht, long mantd,
      String kinhnghiem, String malv) {
    super();
    this.mav = mav;
    this.tenviec = tenviec;
    this.mota = mota;
    this.kynang = kynang;
    this.diadiem = diadiem;
    this.ngaydang = ngaydang;
    this.handk = handk;
    this.ngansachtt = ngansachtt;
    this.ngansachtd = ngansachtd;
    this.maht = maht;
    this.mantd = mantd;
    this.kinhnghiem = kinhnghiem;
    this.malv = malv;
  }

  public long getMav() {
    return mav;
  }

  public void setMav(long mav) {
    this.mav = mav;
  }

  public String getTenviec() {
    return tenviec;
  }

  public void setTenviec(String tenviec) {
    this.tenviec = tenviec;
  }

  public String getMota() {
    return mota;
  }

  public void setMota(String mota) {
    this.mota = mota;
  }

  public String getKynang() {
    return kynang;
  }

  public void setKynang(String kynang) {
    this.kynang = kynang;
  }

  public String getDiadiem() {
    return diadiem;
  }

  public void setDiadiem(String diadiem) {
    this.diadiem = diadiem;
  }

  public Date getNgaydang() {
    return ngaydang;
  }

  public void setNgaydang(Date ngaydang) {
    this.ngaydang = ngaydang;
  }

  public Date getHandk() {
    return handk;
  }

  public void setHandk(Date handk) {
    this.handk = handk;
  }

  public long getNgansachtt() {
    return ngansachtt;
  }

  public void setNgansachtt(long ngansachtt) {
    this.ngansachtt = ngansachtt;
  }

  public long getNgansachtd() {
    return ngansachtd;
  }

  public void setNgansachtd(long ngansachtd) {
    this.ngansachtd = ngansachtd;
  }

  public String getMaht() {
    return maht;
  }

  public void setMaht(String maht) {
    this.maht = maht;
  }

  public long getMantd() {
    return mantd;
  }

  public void setMantd(long mantd) {
    this.mantd = mantd;
  }

  public String getKinhnghiem() {
    return kinhnghiem;
  }

  public void setKinhnghiem(String kinhnghiem) {
    this.kinhnghiem = kinhnghiem;
  }

  public String getMalv() {
    return malv;
  }

  public void setMalv(String malv) {
    this.malv = malv;
  }



}
